import React, { Component } from 'react';
import PlantillaG from '../componentes/PlantillaG';

class Index extends Component {
    render() {
        return (
          <PlantillaG>
              Aca  va todo nuestro contenido 
          </PlantillaG>
        );
    }
}

export default Index;
